import React from "react";
import classes from '../styles/ErrorToast.module.css'

const ErrorToast = ({toastError}) => {
    const rootClass = [classes.ErrorToast];
    if(toastError) {
        rootClass.push(classes.active)
    }
    console.log(rootClass.join(' '))
    return(
        <div className={rootClass} />
    );
};

export default ErrorToast;
